            &:before {
                bottom: 0;
            }

            span {
                top: 50%;
                transform: translateY(-50%);
            }

            .header-nav-active & {

                &:after,
                &:before {
                    content: '';
                    transform: rotate(-45deg);
                    top: 50%;
                }

                &:before {
                    transform: rotate(45deg);
                }

                span {
                    opacity: 0;
                    visibility: hidden;

                    &:after {
                        opacity: 0;
                        visibility: hidden;
                    }
                }
            }
        }

        &-drop {
            position: fixed;
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
            background: $yellow;
            opacity: 0;
            visibility: hidden;
            transform: translateX(100%);
